svg.script:

window.addEventListener("DOMContentLoaded", onResizeFunction);
window.addEventListener("resize", onResizeFunction);

function onResizeFunction (e) {
  var namesHidden=2;
  var width = window.innerWidth;
  //console.log("Resized: " + width + " " + namesHidden);
  if((width < 460)&&(namesHidden!=1)){
    namesHidden = 1;
    document.getElementById("Group_2581").style.display = 'none';
    document.getElementById("Group_2587").style.display = 'none';
    document.getElementById("Group_2585").style.display = 'none';
    document.getElementById("Group_2575").style.display = 'none';
    document.getElementById("Group_2577").style.display = 'none';
    document.getElementById("Group_2579").style.display = 'none';
    document.getElementById("Group_2583").style.display = 'none';
  }
  else if((width >= 460)&&(namesHidden!=0)){
    namesHidden==0;
    document.getElementById("Group_2581").style.display = 'block';
    document.getElementById("Group_2587").style.display = 'block';
    document.getElementById("Group_2585").style.display = 'block';
    document.getElementById("Group_2575").style.display = 'block';
    document.getElementById("Group_2577").style.display = 'block';
    document.getElementById("Group_2579").style.display = 'block';
    document.getElementById("Group_2583").style.display = 'block';
  }
};
